    getEyeBrows(token: Token) {
        let result = this.getBrow(token.eyeType, token.species, token.skinColor, token.speciesOption);
        return result.replace(SpeciesRestrictions.DEFAULT_HAIR_COLOR_REGEX, token.hairColor);
    }
